import CourseVideoContent from "./CourseVideoContent";
import CourseTabs from "./CourseTabs/Course-Tab";
import Container from "@material-ui/core/Container";

export default class CourseContainer2 extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      height: 0
    };
  }

  componentDidMount() {}

  onResize = (width, height) => {
    console.log(width, height);
    this.setState({
      height: height
    });
  };

  render() {
    return (
      <div>
        <CourseVideoContent onResize={this.onResize} height={this.state.height}></CourseVideoContent>
      <Container className={classes.container} maxWidth="lg">
          <CourseTabs></CourseTabs>
      </Container>
      </div>

    );
  }
}
